import React, { Component } from 'react'
import {Line} from 'react-chartjs-2'
// const open = [65, 10, 13, 25, 35, 59, 80, 81, 56, 55, 40,30]
// const high =[20, 30, 40, 50, 60, 70, 80,30,20,10, 12,20]
// const low =[1, 5, 10, 15, 20, 25, 30, 40, 50, 60,70,40]
// const close =[8, 16, 24, 32, 40, 48, 56,64,72,80,88,10]
// const volume =[4, 8, 12, 16, 20, 24, 28, 32, 36, 40,44,50]
let open = []
let high = []
let low = []
let close = []
let volume = []
let labelsX = []
let data = {
    labels: labelsX,
    datasets: [
      {
        label: 'Open',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(255,0,0,1)',
        borderColor: 'rgba(255,0,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(255,0,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(255,0,0,1)',
        pointHoverBorderColor: 'rgba(255,0,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: open
      },
      {
        label: 'High',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,0,255,1)',
        borderColor: 'rgba(0,0,255,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,0,255,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,0,255,1)',
        pointHoverBorderColor: 'rgba(0,0,255,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: high
      },
      {
        label: 'low',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,255,0,1)',
        borderColor: 'rgba(0,255,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,255,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,255,0,1)',
        pointHoverBorderColor: 'rgba(0,255,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: low
      },
      {
        label: 'Close',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,0,0,1)',
        borderColor: 'rgba(0,0,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,0,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,0,0,1)',
        pointHoverBorderColor: 'rgba(0,0,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: close
      },
      {
        label: 'Volume',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(255,255,0,1)',
        borderColor: 'rgba(255,255,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(255,255,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(255,255,0,1)',
        pointHoverBorderColor: 'rgba(255,255,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: volume
      }
    ],
    options: {
        scales: {
            xAxes: [{
                ticks: {
                    callback: function(tick, index, labels) {
                        return (index % 3) ? "" : tick;
                    }
                }
            }],
            yAxes: [{
                ticks: {
                    beginAtZero: false
                }
            }]
        }
    }
  };

export default class FetchRandom extends Component {
    state = {
        loading : true,
        person: null,
        case : '',
    }
    async clear(){
      open = []
      close = []
      low = []
      high = []
      volume = []
      labelsX = []
    }
    async componentDidMount(){
      //this.clear()
      console.log("Here")
      const splittedString = this.props.timeStamps.split(" ")
      var url = 'https://www.fxempire.com/api/v1/en/stocks/chart/candles?Identifier=AAPL.XNAS&IdentifierType=Symbol&AdjustmentMethod=All&IncludeExtended=False&period=' + splittedString[0] + '&Precision=' + splittedString[1] + '&StartTime=8/28/2020%2016:0&EndTime=9/4/2020%2023:59&_fields=ChartBars.StartDate,ChartBars.High,ChartBars.Low,ChartBars.StartTime,ChartBars.Open,ChartBars.Close,ChartBars.Volume'
      const response = await fetch(url)
      const data = await response.json()
      console.log(open.length)
      data.forEach(function (arrayItem) {
        open.push(arrayItem.Open)
        close.push(arrayItem.Close)
        low.push(arrayItem.Low)
        high.push(arrayItem.High)
        volume.push(arrayItem.Volume)
        labelsX.push(arrayItem.Date)
      });
      this.setState({loading: false})
      console.log(close)
      console.log(labelsX)
    }
    render(){
        return (
            <div>
                {this.state.loading ? 
                <div>loading...</div> :
                <div>
                 <Line    
                    data={data}               
                    width={800}
                    height={500}
                    options={{ maintainAspectRatio: false }}
                />
                </div>}
            </div>
        )
    }
}
